import PagesBanner from "./PagesBanner"; // Assuming PagesBanner is a component for displaying a banner
import ProfileComponent from "../Profile/Profile"; // Renamed imported Profile to ProfileComponent

const ProfilePage = () => {
  return (
    <>
      <DesktopHeader />  {/* Add the DesktopHeader component */}
      <PagesBanner title="Your Profile" />  {/* Add PagesBanner with the title */}
      <ProfileComponent />  {/* Use the renamed ProfileComponent */}
    </>
  );
};

export default ProfilePage;
